import "./ProfessorsStyle.css";

function ProfessorRow(props) {
  return (
    <div className="professor-row">
      <div className="table-td">{props.professor.firstname}</div>
      <div className="table-td">{props.professor.lastname}</div>
      <div className="table-td">{props.professor.sex == "M" ? 1 : 0}</div>
      <div className="table-td">{props.professor.academicTitle}</div>
      <div className="table-td">
        <img
          width="40px"
          height="15px"
          className="center-img"
          src={require("../Images/more-info.jpg")}
          alt="More informations"
        />
      </div>
    </div>
  );
}

export default ProfessorRow;
